    "description": "2tec2 provide floor covering woven tiles made of polyvinyl chloride yarn with a glass fiber yarn core, manufactured on Jacquard weaving looms, and finished with a PVC backing reinforced with a non-woven glass fiber veil. Woven vinyl floorings manufactured by 2tec2 are durable floorings designed specifically for high traffic areas while providing high quality thermal and acoustic insulation. The three-layer composition creates a fire- resistant, water and UV-resistant product with low VOC emissions and produced without any hazardous or toxic substances (Reach compliant). Website: http://www.2tec2.com EPD Number: 000168 Date of Issue:30 January 2018 Expiry Date 29 January 2023 BF1805-C Rev 0.0 Page 3 of 17 © BRE Global Ltd, 2017 Technical Information Standards 2tec2 ST Tile Manufacturing process - Woven Backing - Vinyl Total thickness ISO 1765 3,3 mm Total weight ISO 8543 4000 g/m² Tile size (16 tile per box) EN 994 50 cm * 50 cm EN 15114 Class 33 Level of use ASTM D5252 Heavy commercial use Foot traffic test ASTM 06119-12 Heavy traffic Castor Chair suitability EN 985 Continuous use Reaction to fire EN 13501-1 Bfl s1 ASTM E648-10e1 0,99 W/cm² Critical radiant flux NFPA Class I Smoke density ASTM E622-09 < 300 ISO 6356 < 2kv Walking test AATCC 134-2006 Permanently antistatic Light fastness ISO 105-B02 ≥7 EN 13893 ≥ 0,3 Friction ASTM C1028-07 0,85 Impact sound ISO 140-8 14 dB EN 986 Dimensional stability Meets requirements ISO 2551 CE certificate EN 14041 0493-CPR-0036 Main Product Contents This evaluation is carried out by considering “2tec2 Vinyl tile” as representative of the entire range of 2tec2 tiles specific product group. All 2tec2 tile products have the exact same mass and composition, only colours of the external pattern layer may differ, it is considered that the environmental impacts of all products within the tile product group are the same. This includes the followings tile products: · Lustre · New basic · Seamless tiles · Stripes · Cracked earth The conte",
