    "name": "Fabricated steel reinforcing bar (rebar) (ASTM A615, A706)",
    "alt_names": null,
    "description": "This EPD is for fabricated reinforcing bar produced by A&H Steel’s Edmonton, Alberta facility. Fabricated reinforcing bar is a steel bar used in the reinforcement of concrete. The rebar surface is rolled with a deformed pattern in order to form an improved mechanical bond with the concrete. Mechanical properties, sizes, and deformation dimensions are specified by ASTM standards [ASTM A615, A706]. Fabricated rebar has been cut and bent as necessary to form shapes to the needs of a particular project. Rebar sizes range from 10mm to 55mm. In accordance with the PCR, the declared unit and product density is shown in Table 1. Table 1. Declared unit for fabricated reinforcing bar and the approximate density. Parameter Value Density 7800 kg/m3 MATERIAL CONTENT Including alloying elements, the fabricated product is composed of 100% steel. Reinforcing bar products under normal conditions do not present inhalation, ingestion, or contact health hazards. These products, when used inside the building envelope, do not include materials or substances that have a potential route of exposure to humans or flora/fauna in the environment. Table 2. Chemical composition of A615 and A706 reinforcing bar.",
