    "name": "FutureCEM® cement CEM II/B-M (Q-LL) 52,5 N",
    "alt_names": null,
    "description": "FutureCEM cement is a grey Portland-composite cement, of strength class 52.5 N, with a minimum clinker content of 65%. FutureCEM cement is characterized by a high standard strength (62 to 68 MPa after 28 days), comparable to CEM I cements, despite a significantly lower clinker content. FutureCEM cement is prepared by co-milling a mix of Portland cement clinker and gypsum with finegrained limestone filler and calcined clay. FutureCEM cement can be used in concrete for all purposes and in all environmental classes.",
