    "name": "LAVALKALI SULFATBESTANDIG cement",
    "alt_names": null,
    "description": "LOW-ALKALI cement (LAV-ALKALI SULFATBESTANDIG in Danish) is a grey Portland cement, with a strength class of 42.5 N with high sulphate-resistance and low heat generation. The LOW-ALKALI cement can be used for all purposes and in all environmental classes. The LOW-ALKALI cement is specially designed for concrete used for plant constructions and other structures prone to alkali reactions, bridges or structures in contact with sulphate-rich groundwater. This is a dual registered EPD from the system by the Norwegian EPD Foundation, which has the right to bear both logotypes under the mutual recognition agreement between the two programmes.",
