    "name": "Vulcan – Thermally Modified, Glulaminated",
    "alt_names": null,
    "description": "Unlike most premium timbers, which are harvested from unsustainable slow growth forests, Abodo timbers are sourced from rapidly renewable, FSC® certified NZ plantations that help to mitigate climate change by absorbing vast amounts of carbon. Using state-of-the-art thermal modification and grain orientation technology, we craft beautiful timbers that stand the test of time, without disadvantaging future generations. Abodo’s Vulcan timber has superior beauty, durability and weathering characteristics. It’s suitable for coating in darker colours, and is a renewable alternative to Western Red Cedar timber cladding. This EPD has been registered as an ECO Platform EPD with ECO EPD Reference number 00001258. The International EPD System is a founding member of the ECO Platform and its procedures has undergone a peer audit to be able to use this logotype. All EPDs of construction products from different programmes that carry the ECO logotype are listed here.",
