    "name": "ACC Suraksha Power Cement",
    "alt_names": null,
    "description": "ACC Suraksha Power: ACC Suraksha Power is developed through extensive research and is manufactured with the latest technology in state-of- the-art cement plants. This variety of cement requires less water, provides dense and impermeable concrete which increases the long term strength of the structure. ACC Suraksha Power can be handled without segregation. It provides high strength concrete resulting in strong, sturdy and eco-friendly constructions. ACC HPC Long Life: ACC HPC Long life is an engineered slag cement with specialized properties for better workability and cohesive mortar mix in concrete. This increases permeability, resistance to sulphate and chlorides, protects reinforcement against corrosion, reduces heat of hydration resulting in less chances for thermal crack formation. It provides a strong impermeable Cement Paste Matrix. This brand of cement is extensively used to produce high grade concrete, thus rendering concrete structures durable, long lasting and environment-friendly. ACC Concrete+ Xtra Strong: ACC Concrete+ Xtra strong is the latest offering from ACC, India’s leading manufacturer of cement and ready mix concrete. Faster, Stronger, Forever is our promise and Concrete+ Xtra Strong delivers. The product is designed to achieve required strength and better workability for a better and cohesive concrete. Concrete+ Xtra strong is produced by inter-grinding high strength cement clinker with high quality processed fly ash. This product utilises fly ash (a hazardous industrial waste) to help conserve natural resources, thus making it an eco-friendly product. Concrete+ Xtra strong comes in an attractive 50 kg tamper proof bag. ACC Gold Water Shield: ACC Gold Water shield is the only one of its kind, specially formulated cement with high quality water repellent properties. ACC Gold Water shield is a result of minutely controlled process changes under sustainable environment along with adjustments in the input raw material dosage in order to get the desi",
